import { useRouter } from "next/dist/client/router";

export const SubCategoryPage = () => {
  const router = useRouter();
  if (!router) return null;
  const { cid, scid } = router.query;
  console.log(router.query);
  return (
    <div>
      <h1>{cid}</h1>
      <h2>{scid}</h2>
    </div>
  );
};
